import React from 'react';
import GoogleMapReact from 'google-map-react';
function onSelect({x, y, lat, lng, event}){
    console.log(x, y, lat, lng, event)
}
export default function SimpleMap() {
    // var center = {
    //     lat: lat,
    //     long: long
    // }
    var zoom = 11;
    let defaultProps = {
        center: {
          lat: 59.95,
          lng: 30.33
        },
        zoom: 11
      };
    return (
        <div style={{ height: '100vh', width: '100%' }}>
            <GoogleMapReact
                bootstrapURLKeys={{ key: "AIzaSyCZz4jRnJiJ1FMXJbHwdy18jaHzoPuYT84" }}
                defaultCenter={defaultProps.center}
                defaultZoom={defaultProps.zoom}
                onClick={onSelect}
            >

            </GoogleMapReact>
        </div>

    )
}
